import React from "react";
import Fab from "@material-ui/core/Fab";
import AddIcon from "@material-ui/icons/Add";
class Home extends React.Component {
  handle = () => {
    console.log("hi");
  };
  render() {
    return (
      <Fab size="large" color="link" aria-label="Add" onClick={handle}>
        <AddIcon />
      </Fab>
    );
  }
}
export default Home;
